
<!DOCTYPE html>
<html lang="es">
<head>
  <meta charset="UTF-8">
  <title>Miniapp MapTrack CSV</title>
  <style>
    body { font-family: Arial, sans-serif; margin: 20px; }
    button, input[type="file"], input[type="text"] { margin: 5px; padding: 8px; }
    table { border-collapse: collapse; width: 100%; margin-top: 20px; }
    th, td { border: 1px solid #ccc; padding: 8px; text-align: left; }
    th { background-color: #f2f2f2; }
    #searchInput { width: 300px; }
  </style>
</head>
<body>
  <h2>Miniapp MapTrack CSV</h2>
  <input type="file" id="csvFileInput" accept=".csv">
  <button onclick="clearData()">Borrar Data</button>
  <button onclick="saveHTML()">Guardar HTML</button>
  <br>
  <input type="text" id="searchInput" placeholder="Buscar..." oninput="filterTable()">
  <button onclick="clearSearch()">Limpiar Búsqueda</button>
  <table id="dataTable">
    <thead>
      <tr>
        <th>Código</th>
        <th>Cliente</th>
        <th>Placa</th>
        <th>Auxiliar</th>
        <th>Teléfono</th>
        <th>Ubicación</th>
      </tr>
    </thead>
    <tbody></tbody>
  </table>

  <script>
    let originalData = [];

    function clearData() {
      originalData = [];
      document.querySelector("#dataTable tbody").innerHTML = "";
      document.getElementById("searchInput").value = "";
    }

    function clearSearch() {
      document.getElementById("searchInput").value = "";
      renderTable(originalData);
    }

    function saveHTML() {
      const htmlBlob = new Blob([document.documentElement.outerHTML], { type: "text/html" });
      const a = document.createElement("a");
      a.href = URL.createObjectURL(htmlBlob);
      a.download = "maptrack_saved.html";
      a.click();
    }

    function filterTable() {
      const query = document.getElementById("searchInput").value.toLowerCase();
      const filtered = originalData.filter(row =>
        row.Codigo.toLowerCase().includes(query) ||
        row.Cliente.toLowerCase().includes(query) ||
        row.Placa.toLowerCase().includes(query) ||
        row.Pedido.toLowerCase().includes(query)
      );
      renderTable(filtered);
    }

    function renderTable(data) {
      const tbody = document.querySelector("#dataTable tbody");
      tbody.innerHTML = "";
      const uniqueSet = new Set();
      data.forEach(row => {
        const key = `${row.Codigo}|${row.Cliente}|${row.Placa}|${row.Auxiliar}|${row.Telefono}|${row.Ubicacion}`;
        if (!uniqueSet.has(key)) {
          uniqueSet.add(key);
          const tr = document.createElement("tr");
          tr.innerHTML = `
            <td>${row.Codigo}</td>
            <td>${row.Cliente}</td>
            <td>${row.Placa}</td>
            <td>${row.Auxiliar}</td>
            <td>${row.Telefono}</td>
            <td><a href="${row.Ubicacion}" target="_blank">GoogleMaps</a></td>
          `;
          tbody.appendChild(tr);
        }
      });
    }

    document.getElementById("csvFileInput").addEventListener("change", function(e) {
      const file = e.target.files[0];
      if (!file) return;
      const reader = new FileReader();
      reader.onload = function(e) {
        const text = e.target.result;
        const rows = text.split(/\r?\n/);
        const headers = rows[0].split(",");
        const data = [];
        for (let i = 1; i < rows.length; i++) {
          const cols = rows[i].split(",");
          if (cols.length < headers.length) continue;
          const obj = {};
          headers.forEach((h, idx) => obj[h.trim()] = cols[idx] ? cols[idx].trim() : "");
          const razonComercial = obj["RazonComercial"]?.toUpperCase();
          const cliente = (razonComercial && !["0", "N/A", "(BLANK)"].includes(razonComercial)) ?
            `${obj["RazonSocial"]} - ${obj["RazonComercial"]}` : obj["RazonSocial"];
          data.push({
            Codigo: obj["Codigo"] || "",
            Cliente: cliente || "",
            Placa: obj["Placa"] || "",
            Auxiliar: obj["Auxiliar"] || "",
            Telefono: obj["Telefono"] || "",
            Pedido: obj["Pedido"] || "",
            Ubicacion: `https://www.google.com/maps?q=${obj["Latitud"]},${obj["Longitud"]}`
          });
        }
        originalData = data;
        renderTable(data);
      };
      reader.readAsText(file);
    });
  </script>
